INSERT INTO `ps_product_lang` VALUES (2437,1,1,'Kultowy i uwielbiany przez biegaczy Brooks Ghost wraca w nowej odsłonie z membraną GORE-TEX®. Ghost 17 GTX to jeden z najbardziej uniwersalnych modeli butów marki Brooks. Będze idealnym wyborem na treningi o zróżnicowanej długości i planowanym tempie. Wyposażony jest w DNA LOFT v3, która zapewnia miękką i gładką amortyzację, dostosowującą się do Twojego kroku oraz zaufane, pewne dopasowanie. Dzięki membranie GORE-TEX® pozwala cieszyć się odpornością na wodę, przy jednoczesnym zachowaniu właściwości oddychających przez cholewkę. Efektem tego jest bieg bez żadnych rozproszeń. Dzięki temu możesz skupić się w pełni na swoim treningu. Miękka i dynamiczna amortyzacja Amortyzacja DNA LOFT v3, wzbogacona azotem, zapewnia lekką miękkość i komfort, kilometr po kilometrze. Płynne przejścia Nowo zaprojektowana podeszwa środkowa łączy się z precyzyjnymi rowkami elastycznymi, aby wspierać płynność przejścia do odbicia palców. Oddychająca i wodoodporna cholewka Cholewka wykonana w technologii GORE-TEX®, która gwarantuje dobrą oddychalność buta, przy zachowaniu odporności na przemakanie. DLA KOGO: Brooks Ghost 17 GTX jest uniwersalnym butem treningowym, który będzie dobrym wyborem dla większości biegaczy szukających niezawodnego obuwia na zróżnicowane treningi biegowe. DODATKOWE KORZYŚCI GORE-TEX® Invisible Fit jest bezpośrednio połączony z cholewką buta, co zapewnia lekkie i elastyczne dopasowanie, oferujące oddychającą ochronę przed warunkami atmosferycznymi.','','buty-do-biegania-damskie-ghost-17-gtx-na-asfalt-gore-tex-r-jasnoszare','','','','Buty do biegania damskie Ghost 17 GTX na asfalt Gore-Tex®  jasnoszare','','','',''),(2438,1,1,'Buty do biegania po asfalcie Adrenaline GTS 24 Weatherized – męskie Adrenaline GTS 24 Weatherized to model, który wyróżnia doskonałe wsparcie poprawnego ułożenia stopy w bucie. GuideRails® to technologia składająca się z dwóch wytrzymałych kawałków pianki ułożonych po wewnętrznej i zewnętrznej stronie pięty. Utrzymanie stopy przez GuideRails® w naturalnej pozycji oraz amortyzacja zapewniona przez piankę DNA LOFT v3, sprawiają że model ten będzie dla Ciebie komfortowym i bezpiecznym wyborem na każdym dystansie treningowym. Model Weatherized cechuje się zwiększoną odpornością na niską temperaturę i wilgoć towarzyszącą jesienno-zimowej pogodzie. Ceniony przez biegaczy but, teraz w nowym, odpornym na warunki pogodowe wydaniu. Holistyczny system wsparcia GuideRails® Dwa wzmocnione kawałki pianki otaczają piętę biegacza od wewnętrznej i zewnętrznej strony. Zagwarantowane poprawne ułożenie stopy sprawia, że również stawy powyżej pracują w odpowiednim ułożeniu, a całe ciało biegacza utrzymane jest w naturalnej ścieżce ruchu. Dynamiczna amortyzacja Po raz pierwszy w modelu Adrenaline! Nowa podeszwa środkowa została wyposażona w lżejszą, azotową piankę DNA LOFT v3. Wzmocniona cholewka Całkowicie przeprojektowana cholewka z gęstej i grubszej siateczki zapewnia odpowiedni poziom elastyczności, dopasowania oraz temperatury w chłodne dni. DLA KOGO: Adrenaline GTS 24 Weatherized zostały stworzone dla biegaczy, którzy potrzebują butów do biegania ze wsparciem, chcą biegać płynnie w każdej temperaturze. Nie pozwól, by palce zaczęły Ci odmarzać w trakcie biegu! DODATKOWE KORZYŚCI Zastowanie najbardziej zaawansowanej pianki DNA LOFT v3, co zapewnia udoskonalone, miękkie uczucie i jest jeszcze lżejsza niż wcześniej. Kompletnie odświeżony design całej sylwetki buta – od podeszwy dolnej, po całą cholewkę. Wszystko po to, by bieg stał się jeszcze bardziej komfortowy. Bieżnik i struktura siateczki są przygotowane na chłód.','','buty-do-biegania-meskie-adrenaline-gts-24-weatherized-na-asfalt-zielonoszare','','','','Buty do biegania męskie Adrenaline GTS 24 Weatherized na asfalt zielonoszare','','','',''),(2439,1,1,'Buty do biegania po asfalcie Glycerin Max 2 – damskie Poczuj, jak bieganie po asfalcie staje się czystą przyjemnością z butami Glycerin Max 2 od Brooks. To model stworzony dla kobiet, które nie chcą rezygnować z treningów nawet na najdłuższych dystansach po utwardzonych nawierzchniach. Zaawansowana technologia amortyzacji sprawia, że Twoje nogi pozostają wypoczęte, a każdy krok jest lekki i pełen energii – niezależnie od tego, czy to Twój pierwszy kilometr, czy dwudziesty. Buty do biegania po asfalcie damskie Glycerin Max 2 łączą w sobie innowacyjną piankę DNA TUNED z technologią GlideRoll™ Rocker, tworząc harmonię miękkości i dynamiki. To idealne obuwie dla biegaczek o neutralnej stopie, które szukają maksymalnej ochrony na asfalcie i twardych nawierzchniach. Zapomnij o zmęczeniu – pozwól butom pracować za Ciebie. Biegnij bez końca. Ciesz się każdym krokiem. Inteligentna amortyzacja dostosowana do Twojej stopy Technologia DNA TUNED z azotową pianką to prawdziwy przełom. W pięcie znajdziesz większe komórki pianki, które delikatnie amortyzują każde lądowanie. W przedniej części stopy mniejsze komórki dodają energii do wybicia. Wszystko w jednej, idealnie zestrojonej warstwie. Płynność ruchu na każdym podłożu GlideRoll™ Rocker to technologia, która sprawia, że przetaczanie stopy z pięty na palce staje się naturalne i bezwysiłkowe, a wybicie dynamiczne. Specjalnie wyprofilowana podeszwa pomaga oszczędzać energię i redukuje obciążenie stawów, dzięki czemu możesz biegać dłużej bez dyskomfortu. Wyjątkowa wysokość amortyzacji chroniąca przed zmęczeniem Glycerin Max 2 to buty z maksymalną ilością amortyzacji, która działa jak poduszka ochronna dla Twoich stóp, kolan i bioder. Niezależnie od tego, czy trenujesz do maratonu, czy po prostu uwielbiasz długie wybiegania, poczujesz różnicę już po pierwszym biegu. Dlaczego warto wybrać buty do biegania po asfalcie Glycerin Max 2? Buty Glycerin Max 2 zostały zaprojektowane z myślą o biegaczkach, które stawiają na komfort i ochronę bez kompromisów. To obuwie, które pozwala Ci skupić się na biegu, a nie na bólu czy zmęczeniu. Szczególnie docenią to kobiety biegające po asfalcie i utwardzonych nawierzchniach. ✅ Pianka DNA TUNED nasycona azotem – dwuwarstwowa struktura pianki zapewnia miękkie lądowania i energiczne wybicia, idealnie dopasowane do kobiecej anatomii stopy. ✅ Technologia GlideRoll™ Rocker z wyprofilowaną podeszwą – naturalny ruch stopy, mniejsze obciążenie stawów, kolan i bioder oraz więcej energii na kolejne kilometry. ✅ Potężna dawka amortyzacji – maksymalna ochrona przed wstrząsami, która pozwala Twoim nogom czuć się świeżo nawet po godzinach treningu. ✅ Neutralne wsparcie dla naturalnego kroku – idealne dla biegaczek bez nadmiernej pronacji, które cenią sobie swobodę ruchu. ✅ Lekka konstrukcja mimo wysokiej amortyzacji – zaledwie 320 g, co sprawia, że buty nie spowalniają Twojego tempa. ✅ Drop 6 mm dla naturalnej postawy – wspiera efektywną technikę biegu i redukuje obciążenie łydek.','','buty-do-biegania-damskie-glycerin-max-2-na-asfalt-szare','','','','Buty do biegania damskie Glycerin Max 2 na asfalt szare','','','',''),(2440,1,1,'Buty do biegania po asfalcie Glycerin Max 2 – męskie Odkryj nowy wymiar komfortu z butami do biegania Glycerin Max 2 od Brooks. Ten model został zaprojektowany, aby dostarczyć Ci maksymalną amortyzację i ochronę na każdym kilometrze przebiegniętym po utwardzonej nawierzchni. Poczuj, jak Twoje nogi pozostają świeże nawet po najdłuższych wybieganiach, dzięki innowacyjnym technologiom, które rewolucjonizują pojęcie miękkości. Buty męskie do biegania po asfalcie Glycerin Max 2 to idealny wybór dla biegaczy o stopie neutralnej, którzy szukają luksusowego komfortu i płynnego przetaczania stopy. To model dla tych, którzy chcą biec bez końca, ciesząc się każdym krokiem i zapominając o zmęczeniu. Poczuj różnicę, jaką daje maksymalna amortyzacja. Maksimum miękkości. Maksimum energii. Maksimum ochrony. Naukowe arcydzieło – mistrzowsko dostrojona amortyzacja Ciesz się niezrównaną miękkością i dynamiką. Dzięki piance DNA TUNED nasyconej azotem, but oferuje duże komórki pianki w pięcie dla supermiękkich lądowań i mniejsze komórki w przedniej części stopy dla energicznego wybicia. Wszystko w jednej, bezszwowej warstwie amortyzacji. Niezrównana łatwość – płynne przetaczanie stopy Technologia GlideRoll™ Rocker ze specjalnie wyprofilowaną piętą i uniesionymi palcami, pomaga Twojej stopie płynnie przechodzić od lądowania do wybicia. Biegnij bez wysiłku, oszczędzając energię na kolejne kilometry. Potęga amortyzacji – maksymalna ochrona stawów Zaprojektowane, by Twoje nogi czuły się świeżo, a stawy i kolana bezpiecznie. Przełomowa ilość amortyzacji pochłania wstrząsy chroniąc przed uderzeniami, dzięki czemu możesz biegać dłużej i bardziej komfortowo niż kiedykolwiek wcześniej. Dlaczego warto wybrać męskie buty do biegania po asfalcie Glycerin Max 2? Męskie buty do biegania Glycerin Max 2 są stworzone dla biegaczy, którzy oczekują maksymalnego komfortu i ochrony na twardych nawierzchniach. Wszystkie elementy buta zostały zaprojektowane tak, aby wspierać Cię w biegu bez końca, minimalizując zmęczenie i maksymalizując przyjemność. ✅ Amortyzacja DNA TUNED – nasączona azotem pianka zapewnia luksusowo miękkie lądowania i dynamiczne wybicia, idealnie dostrojone do Twojego kroku. ✅ Technologia GlideRoll™ Rocker – ułatwia płynne przetaczanie stopy, redukując obciążenie i zwiększając efektywność biegu. ✅ Maksymalna wysokość podeszwy – potężna dawka amortyzacji chroni Twoje stawy i mięśnie, pozwalając Ci czuć się świeżo nawet po długim treningu. ✅ Neutralne wsparcie – idealne dla biegaczy o neutralnym typie stopy, którzy nie potrzebują dodatkowej korekcji. ✅ Luksusowe odczucia pod stopą – poczuj się jakbyś biegał po chmurach, dzięki wyjątkowo miękkiej konstrukcji. ✅ Niski drop (6 mm) – sprzyja naturalnemu ułożeniu stopy i bardziej efektywnej technice biegu.','','buty-do-biegania-meskie-glycerin-max-2-na-asfalt-jasnoszare','','','','Buty do biegania męskie Glycerin Max 2 na asfalt jasnoszare','','','',''),(2441,1,1,'Buty do biegania po asfalcie Glycerin Max 2 – męskie Odkryj nowy wymiar komfortu z butami do bieg