unkach Podeszwa TrailTack Green wykonana jest w 25% z materiałów z recyklingu i zapewnia przyczepność na różnych nawierzchniach w warunkach mokrych i suchych. Wodoodporne dzięki Gore-Tex® Warstwa membrany zespojona z cholewką zapewnia komfortowy bieg podczas deszczu, czy mokrej nawierzchni. DLA KOGO: Ten but jest stworzony dla każdego, kto chce czuć pewność i niezawodność odbicia w każdym trailowym terenie. Ten but nie szuka kompromisów, tylko sprawdza się w każdych warunkach. DODATKOWE KORZYŚCI Nowy system Trail Adapt zastosowany w podeszwie Nowa technologia amortyzacji Nitrogen-infused DNA LOFT v3 Przyczepna podeszwaTrailTack Green Membrana Gore-Tex Invisible Fi','','buty-do-biegania-damskie-cascadia-gtx-19-w-terenie-gore-tex-r-czarne','','','','Buty do biegania damskie Cascadia GTX 19 w terenie Gore-Tex® czarne','','','',''),(2559,1,1,'Pełny komfort podczas długich biegów w terenie.Caldera 8mają wygodną, nasyconą azotem piankęDNA LOFT v3, która jest lekka i trwała, a do tego także odporną, oddychającą cholewkę z siateczkiTPEE. TechnologiaTrailTack Greenzapewnia płynny i stabilny bieg po trudnym terenie. Teraz w nowym wydaniu! Ultrakomfort na każdą przygodę. Trwałe i dynamiczne Ulepszona cholewka zapewnia bezpieczne dopasowanie w środkowej części stopy, podczas gdy oddychająca siateczka TPEE gwarantuje ochronę i odprowadzenie wilgoci w każdych warunkach. Stabilny bieg Strategicznie podwyższona pianka podeszwy środkowej zapewnia bezpieczeństwo i elastyczność tam, gdzie tego potrzebujesz. Poszerzona podstawa i specjalne rowki w podeszwie zewnętrznej stabilizują lądowanie i zapewniają płynność ruchu na nierównym terenie. Niesamowita miękkość Bardzo miękka, nasycona azotem amortyzacja DNA LOFT v3 jest lekka, responsywna, trwała i zapewnia Ci wygodę na długie kilometry. DLA KOGO: Buty są przeznaczone dla biegaczy, którzy oczekują najwyższego komfortu i stabilności podczas długodystansowych biegów w terenie. DODATKOWE KORZYŚCI Nowy materiał z siateczką TPEE jest trwały, lekki i oddycha. Podeszwa zewnętrzna TrailTack Green zapewnia przyczepność na mokrych i  suchych nawierzchniach i jest wykonana co najmniej w 25% z materiałów pochodzących z recyklingu. Nowa konstrukcja podeszwy zewnętrznej zapewnia lepszą stabilność, adaptację i przyczepność podczas biegu. Boki buta są elastyczniejsze, co zapewnia lepszą kontrolę i większy komfort. Aby buty Caldera 8 były neutralne pod względem emisji dwutlenku węgla, obniżamy emisję gazów, zwiększając wykorzystanie materiałów pochodzących z recyklingu. Wspieramy niezależnie zweryfikowane projekty kompensacji emisji dwutlenku węgla, których celem jest zneutralizowanie pozostałej emisji.','','buty-do-biegania-meskie-caldera-8-w-terenie-niebieskie','','','','Buty do biegania męskie Caldera 8 w terenie niebieskie','','','',''),(2560,1,1,'Pełny komfort podczas długich biegów w terenie.Caldera 8mają wygodną, nasyconą azotem piankęDNA LOFT v3, która jest lekka i trwała, a do tego także odporną, oddychającą cholewkę z siateczkiTPEE. TechnologiaTrailTack Greenzapewnia płynny i stabilny bieg po trudnym terenie. Teraz w nowym wydaniu! Ultrakomfort na każdą przygodę. Trwałe i dynamiczne Ulepszona cholewka zapewnia bezpieczne dopasowanie w środkowej części stopy, podczas gdy oddychająca siateczka TPEE gwarantuje ochronę i odprowadzenie wilgoci w każdych warunkach. Stabilny bieg Strategicznie podwyższona pianka podeszwy środkowej zapewnia bezpieczeństwo i elastyczność tam, gdzie tego potrzebujesz. Poszerzona podstawa i specjalne rowki w podeszwie zewnętrznej stabilizują lądowanie i zapewniają płynność ruchu na nierównym terenie. Niesamowita miękkość Bardzo miękka, nasycona azotem amortyzacja DNA LOFT v3 jest lekka, responsywna, trwała i zapewnia Ci wygodę na długie kilometry. DLA KOGO: Buty są przeznaczone dla biegaczy, którzy oczekują najwyższego komfortu i stabilności podczas długodystansowych biegów w terenie. DODATKOWE KORZYŚCI Nowy materiał z siateczką TPEE jest trwały, lekki i oddycha. Podeszwa zewnętrzna TrailTack Green zapewnia przyczepność na mokrych i  suchych nawierzchniach i jest wykonana co najmniej w 25% z materiałów pochodzących z recyklingu. Nowa konstrukcja podeszwy zewnętrznej zapewnia lepszą stabilność, adaptację i przyczepność podczas biegu. Boki buta są elastyczniejsze, co zapewnia lepszą kontrolę i większy komfort. Aby buty Caldera 8 były neutralne pod względem emisji dwutlenku węgla, obniżamy emisję gazów, zwiększając wykorzystanie materiałów pochodzących z recyklingu. Wspieramy niezależnie zweryfikowane projekty kompensacji emisji dwutlenku węgla, których celem jest zneutralizowanie pozostałej emisji.','','buty-do-biegania-damskie-caldera-8-w-terenie-czarne','','','','Buty do biegania damskie Caldera 8 w terenie czarne','','','',''),(2561,1,1,'Pełny komfort podczas długich biegów w terenie. Caldera 8 mają wygodną, nasyconą azotem piankę DNA LOFT v3, która jest lekka i trwała, a do tego także odporną, oddychającą cholewkę z siateczki TPEE. Technologia TrailTack Green zapewnia płynny i stabilny bieg po trudnym terenie. Teraz w nowym wydaniu!Ultrakomfort na każdą przygodę.Trwałe i dynamiczne Ulepszona cholewka zapewnia bezpieczne dopasowanie w środkowej części stopy, podczas gdy oddychająca siateczka TPEE gwarantuje ochronę i odprowadzenie wilgoci w każdych warunkach.Stabilny bieg Strategicznie podwyższona pianka podeszwy środkowej zapewnia bezpieczeństwo i elastyczność tam, gdzie tego potrzebujesz. Poszerzona podstawa i specjalne rowki w podeszwie zewnętrznej stabilizują lądowanie i zapewniają płynność ruchu na nierównym terenie.Niesamowita miękkość Bardzo miękka, nasycona azotem amortyzacja DNA LOFT v3 jest lekka, responsywna, trwała i zapewnia Ci wygodę na długie kilometry. DLA KOGO: Buty są przeznaczone dla biegaczy, którzy oczekują najwyższego komfortu i stabilności podczas długodystansowych biegów w terenie. DODATKOWE KORZYŚCI Nowy materiał z siateczką TPEE jest trwały, lekki i oddycha.Podeszwa zewnętrzna TrailTack Green zapewnia przyczepność na mokrych i  suchych nawierzchniach i jest wykonana co najmniej w 25% z materiałów pochodzących z recyklingu.Nowa konstrukcja podeszwy zewnętrznej zapewnia lepszą stabilność, adaptację i przyczepność podczas biegu.Boki buta są elastyczniejsze, co zapewnia lepszą kontrolę i większy komfort. Aby buty Caldera 8 były neutralne pod względem emisji dwutlenku węgla, obniżamy emisję gazów, zwiększając wykorzystanie materiałów pochodzących z recyklingu. Wspieramy niezależnie zweryfikowane projekty kompensacji emisji dwutlenku węgla, których celem jest zneutralizowanie pozostałej emisji.','','buty-do-biegania-damskie-caldera-8-w-terenie-czarne','','','','Buty do biegania damskie Caldera 8 w terenie czarne','','','',''),(2562,1,1,'Catamount 4 ułatwiają Ci utrzymanie szybkości w czasie biegu trailowego. Lekka, nasycona azotem amortyzacja DNA FLASH v2 ułatwia biegaczom zwinne pokonywanie przeszkód. Specjalnie zaprojektowana płytka SkyVault pcha Cię pod górę, dodając szybkości i pewności na każdym kroku. Wysokiej jakości jednowarstwowa siateczka TPEE zapewnia trwałość i wygodę. Technologia wspierająca przyczepność, TrailTack Green, sprawia, że but jest doskonałym wyborem dla osób biegających w terenie.Lekkie i szybkieWydajność pod górę Płytka SkyVault zapewnia napęd potrzebny do zdobywania szczytów i zwiększania tempa.Przyczepność TrailTrack Gumowa podeszwa zewnętrzna w technologii TrailTack Green jest wykonana w 25% z materiałów z recyklingu. Zapewnia doskonałą przyczepność zarówno na mokrych, jak i suchych nawierzchniach.Lekka i responsywna amortyzacja Podeszwa środkowa nasączona azotem, DNA FLASH v2, jest lekka i zapewnia idealne połączenie responsywności i elastycznej amortyzacji podczas szybkiego biegu. DLA KOGO: Ten but jest stworzony dla każdego, kto chce czuć pewność i niezawodność odbicia w każdym trailowym terenie. Ten but nie szuka kompromisów, tylko sprawdza się w każdych warunkach. DODATKOWE KORZYŚCI Nowy system Trail Adapt zastosowany w podeszwie Nowa technologia am