zemakalny. Idealny wybór na sezon jesienno-zimowy. Przejście z ulicy na szlak Miękka amortyzacjaDNA LOFT v2zapewnia gładki bieg po drogach i szlakach, podczas gdy wypustki w podeszwie oferują doskonałą przyczepność na nawierzchni off-roadowej. Mega przyczepność PodeszwaTrailTack Greenwykonana jest w 25% z materiałów z recyklingu i zapewnia przyczepność na różnych nawierzchniach w warunkach mokrych i suchych. DLA KOGO: Divide 6 GTX jest stworzony dla biegaczy, którzy pragną zejść z asfaltowych ścieżek i spróbować swoich sił podczas biegania w terenie. DODATKOWE KORZYŚCI Certyfikat CarbonNeutral® – Aby uzyskać certyfikację dla tego modelu, zwiększamy wykorzystanie materiałów z recyklingu, aby obniżyć emisjędwutlenku węgla, a następnie wspieramy projekty kompensacji węgla, aby zneutralizować emisje, których jeszcze nie możemy wyeliminować.','','buty-do-biegania-meskie-divide-gtx-6-w-terenie-gore-tex-r-czarne','','','','Buty do biegania męskie Divide GTX 6 w terenie Gore-Tex® czarne','','','',''),(2568,1,1,'Divide 6oferuje bardzo dobre dopasowanie butów do stopy, podczas biegania w terenie. Ten model butów oferuje biegaczowi dużą pewność podczas poruszania się po trailowych ścieżkach. Jest niesamowicie dobrze zbalansowany, lekki, wspierający i elastyczny. Charakteryzuje się doskonałą przyczepnością. Lekki i wygodny but do biegania w terenie Dobrze znane dopasowanie Dopasowanie inspirowane butami do biegania na asfalcie. Cholewka zapewnia oddychalność i komfort, podczas gdy nakładki z TPU pomagają zapewnić trwałość i ochronę. Przejście z ulicy na szlak Miękka amortyzacja DNA LOFT v2 zapewnia gładki bieg po drogach i szlakach, podczas gdy wypustki w podeszwie oferują doskonałą przyczepność na nawierzchni off-roadowej. Mega przyczepność Podeszwa TrailTack Green wykonana jest w 25% z materiałów z recyklingu i zapewnia przyczepność na różnych nawierzchniach w warunkach mokrych i suchych. DLA KOGO: Divide 6 jest stworzony dla biegaczy, którzy pragną zejść z asfaltowych ścieże