o unowocześniona wersja ciepłej odzieży zaprojektowanej na jesienno-zimowe treningi. Wykonana z trwałego i oddychającego materiału, doskonale sprawdza się w chłodne dni, zapewniając komfort termiczny oraz wysoką przepuszczalność powietrza. Model wyposażono w praktyczny kaptur, który można łatwo złożyć, oraz wysoką stójkę, co sprawia, że bluza nie krępuje ruchów nawet podczas intensywnych treningów. Nowa odsłona bluzy Brooks Thermal Notch Hoodie 2.0 zawiera zamek błyskawiczny pozwalający na regulację temperatury, a także zamykaną kieszeń, idealną do przechowywania drobiazgów, takich jak klucze czy karta. Dodatkowo, w rękawach znajdują się wycięcia na zegarek biegowy, co jest praktycznym udogodnieniem. Bluza może być noszona jako pierwsza warstwa odzieży lub – w chłodniejsze dni – z koszulką termoaktywną, z długim lub krótkim rękawem.','','bluza-do-biegania-damska-z-kapturem-ocieplana-notch-thermal-hoodie-2-0','','','','Bluza do biegania damska z kapturem ocieplana Notch Thermal Hoodie 2.0','','','',''),(2603,1,1,'None','','bluza-do-biegania-damska-dash-1-2-zip-niebieska','','','','Bluza do biegania damska Dash 1/2 zip niebieska','','','',''),(2604,1,1,'None','','bluza-do-biegania-damska-run-visible-1-2-zip-odblaskowa-biala','','','','Bluza do biegania damska Run Visible ½ zip odblaskowa biała','','','',''),(2605,1,1,'Brooks High Point Tight to męskie legginsy do biegania, idealne na chłodne, jesienno-zimowe dni. Wykonane z elastycznej tkaniny skutecznie odprowadzają wilgoć, zapewniając komfort podczas intensywnych treningów. Dodatkowe panele na przedniej części nogawek i wokół łydek mają wodoodporną i wiatroszczelną powłokę, która chroni przed niekorzystnymi warunkami pogodowymi.Przygotowane na wszystko!Ochrona przed wiatrem i deszczem Elastyczny, odprowadzający pot materiał z panelami, które zapewnią Ci ochronę przed wiatrem i deszczem.Gotowe na wspinaczkę Silikonowa warstwa nadrukowana na udach pomoże Ci podczas najcięższych wspinaczek. Oprzyj ręce na udachi w drogę!Bezpieczny schowek Różne rodzaje kieszeni pozwolą na odpowiednie rozmieszczenie Twoich niezbędnych drobiazgów podczas biegu. Model posiada wpuszczaną kieszonkę po lewej stronie, zamykaną na suwak po prawej, oraz kieszeń z tyłu – idealne na przechowanie drobiazgów. Regulowany pas ze sznurkiem umożliwia idealne dopasowanie, a odblaskowe elementy poprawiają widoczność po zmroku. Najważniejsze cechy: dobrze dopasowany krój z wyższym stanempas z regulacją na sznurekwodoodporne i wiatroszczelne panelepraktyczne kieszonkielementy odblaskowe','','spodnie-do-biegania-meskie-high-point-tight-czarne','','','','Spodnie do biegania męskie High Point Tight czarne','','','',''),(2606,1,1,'None','','spodnie-do-biegania-damskie-spark-capri-granatowe','','','','Spodnie do biegania damskie Spark Capri granatowe','','','',''),(2607,1,1,'Brooks High Point Tight to damskie legginsy do biegania, idealne na chłodne, jesienno-zimowe dni. Wykonane z elastycznej tkaniny skutecznie odprowadzają wilgoć, zapewniając komfort podczas intensywnych treningów. Dodatkowe panele na przedniej części nogawek i wokół łydek mają wodoodporną i wiatroszczelną powłokę, która chroni przed niekorzystnymi warunkami pogodowymi.Przygotowane na wszystko!Ochrona przed wiatrem i deszczem Elastyczny, odprowadzający pot materiał z panelami, które zapewnią Ci ochronę przed wiatrem i deszczem.Gotowe na wspinaczkę Silikonowa warstwa nadrukowana na udach pomoże Ci podczas najcięższych wspinaczek. Oprzyj ręce na udachi w drogę!Bezpieczny schowek Różne rodzaje kieszeni pozwolą na odpowiednie rozmieszczenie Twoich niezbędnych drobiazgów podczas biegu. Model posiada wpuszczaną kieszonkę po lewej stronie, zamykaną na suwak po prawej, oraz kieszeń z tyłu – idealne na przechowanie drobiazgów. Regulowany pas ze sznurkiem umożliwia idealne dopasowanie, a odblaskowe elementy poprawiają widoczność po zmroku. Najważniejsze cechy: dobrze dopasowany krój z wyższym stanempas z regulacją na sznurekwodoodporne i wiatroszczelne paneleprak